rule "Syslog - VMWARE VCSA - extract vmw_vc_domain from vmw_vc_user"
when
  has_field("vmw_vc_user") AND regex("Event \\[", to_string($message.message)).matches == true
then
  let msg = to_string($message.vmw_vc_user);

  let vcsa15 = grok(pattern: "%{DATA:vmw_vc_domainuser}\\@%{GREEDYDATA:vmw_vc_domain}", value: to_string(msg), only_named_captures: true);
  set_fields(vcsa15);

   let vcsa16 = grok(pattern: "%{DATA:vmw_vc_domain}\\\\%{GREEDYDATA:vmw_vc_domainuser}", value: to_string(msg), only_named_captures: true);
  set_fields(vcsa16);

end

rule "Syslog - VMWARE ESXI - vpxd-main"
when
  has_field("application_name") AND regex("vpxd-main", to_string($message.application_name)).matches == true AND regex("\\[VpxLRO\\]", to_string($message.message)).matches == false
then
  let msg = to_string($message.message);

  let vpxd_main1 = grok(pattern: "%{YEAR}-%{MONTHNUM}-%{MONTHDAY}[T]%{HOUR}:?%{MINUTE}(?::?%{SECOND})\\+%{DATA:TZ} %{DATA:vmw_vc_info} %{DATA:vmw_vc_component}\\[%{DATA:vmw_vc_component_id}\\] \\[%{GREEDYDATA:vmw_vc_orig_sub_opid_elements}\\] %{GREEDYDATA:vmw_vc_desc}", value: to_string(msg), only_named_captures: true);
  set_fields(vpxd_main1);

end

