rule "VMWARE vmw_vc_ssoadminserver_action"

when 
    has_field("vmw_vc_ssoadminserver_action")
then

  let msg = to_string($message.vmw_vc_ssoadminserver_action);

  let ssoadminserveraction1 = grok(pattern: "vmw_vc_user account \\'\\{Name: %{DATA:vmw_vc_sso_name}\\, Domain: %{DATA:vmw_vc_sso_domain}\\}\\'", value: to_string(msg), only_named_captures: true);
  set_fields(ssoadminserveraction1);

  let ssoadminserveraction2 = grok(pattern: "principal \\'%{DATA:vmw_vc_sso_name}\\'", value: to_string(msg), only_named_captures: true);
  set_fields(ssoadminserveraction2);

  let ssoadminserveraction3 = grok(pattern: "local %{DATA:vmw_vc_target_type} vmw_vc_user \\'%{DATA:vmw_vc_sso_name}\\' with", value: to_string(msg), only_named_captures: true);
  set_fields(ssoadminserveraction3);

  let ssoadminserveraction4 = grok(pattern: "local %{DATA:vmw_vc_target_type} vmw_vc_user \\'%{DATA:vmw_vc_sso_name}\\' %{DATA:vmw_vc_resetting_target}word", value: to_string(msg), only_named_captures: true);
  set_fields(ssoadminserveraction4);

  let ssoadminserveraction5 = grok(pattern: "local %{DATA:vmw_vc_target_type} \\'%{DATA:vmw_vc_sso_name}\\' with", value: to_string(msg), only_named_captures: true);
  set_fields(ssoadminserveraction5);

  let ssoadminserveraction6 = grok(pattern: "users \\'\\[\\{Name: %{DATA:vmw_vc_sso_name}\\, Domain: %{DATA:vmw_vc_sso_domain}\\}\\]\\' to local %{DATA:vmw_vc_target_type} '%{DATA:vmw_vc_target_group}'", value: to_string(msg), only_named_captures: true);
  set_fields(ssoadminserveraction6);

  let ssoadminserveraction7 = grok(pattern: "principals \\'\\[\\{Name: %{DATA:vmw_vc_sso_name}\\, Domain: %{DATA:vmw_vc_sso_domain}\\}\\]\\' from local %{DATA:vmw_vc_target_type} '%{DATA:vmw_vc_target_group}'", value: to_string(msg), only_named_captures: true);
  set_fields(ssoadminserveraction7);

  let ssoadminserveraction8 = grok(pattern: "local password %{GREEDYDATA:vmw_vc_password_type}", value: to_string(msg), only_named_captures: true);
  set_fields(ssoadminserveraction8);


end

rule "Syslog - VMWARE ESXI - vpxd-main 02"
when
  has_field("application_name") AND regex("vpxd-main", to_string($message.application_name)).matches == true AND regex("\\[VpxLRO\\]", to_string($message.message)).matches == false
then

  let msg2 = to_string($message.vmw_vc_orig_sub_opid_elements);
  let msg3 = to_string($message.vmw_vc_desc);



  let vpxd_main3 = grok(pattern: "%{DATA:vmw_vc_vmware_value1} vmw_vc_sub=%{DATA:vmw_vc_sub} vmw_vc_opID=%{GREEDYDATA:vmw_vc_opID}", value: to_string(msg2), only_named_captures: true);
  set_fields(vpxd_main3);

  let vpxd_main4 = grok(pattern: "annotation = %{DATA:vmw_vc_virtual_machine_note}\\,  \\} to VM ds:%{DATA:vmw_vc_virtual_machine_pathname} on host %{IPV4:vmw_vc_esxi_hosting_ip}", value: to_string(msg3), only_named_captures: true);
  set_fields(vpxd_main4);

end

