rule "Syslog - VMWARE VCSA - 02"
when
  has_field("vmw_vc_desc") AND regex("Event \\[", to_string($message.message)).matches == true
then
  let msg = to_string($message.vmw_vc_desc);

  let vcsa2 = grok(pattern: "User %{DATA:vmw_vc_auth_user}\\@%{IPV4:vmw_vc_auth_src_ip} logged %{DATA:vmw_vc_logged_action} as %{GREEDYDATA:vmw_vc_auth_type}", value: to_string(msg), only_named_captures: true);
  set_fields(vcsa2);

  let vcsa4 = grok(pattern: "User %{DATA:vmw_vc_auth_user}\\@%{IPV4:vmw_vc_auth_src_ip} logged %{WORD:vmw_vc_logged_action} \\(login time: %{DAY:vmw_vc_login_day}\\, %{BASE10NUM:vmw_vc_login_date} %{MONTH:vmw_vc_login_monthday}\\, %{YEAR:vmw_vc_login_year} %{TIME:vmw_vc_login_time} %{WORD:vmw_vc_login_time_format}\\, number of API invocations: %{BASE10NUM:vmw_vc_total_api_calls}\\, vmw_vc_user agent: %{GREEDYDATA:vmw_vc_login_auth_type}\\)", value: to_string(msg), only_named_captures: true);
  set_fields(vcsa4);

  let vcsa5 = grok(pattern: "A %{DATA:vmw_vc_target_object} for %{DATA:vmw_vc_virtual_machine_name} of type %{DATA:vmw_vc_ticket_type} on %{IPV4:vmw_vc_esxi_hosting_ip} in %{HOSTNAME:vmw_vc_datacenter_name} %{GREEDYDATA:vmw_vc_status_action}", value: to_string(msg), only_named_captures: true);
  set_fields(vcsa5);

  let vcsa6 = grok(pattern: "Task: %{GREEDYDATA:vmw_vc_task}", value: to_string(msg), only_named_captures: true);
  set_fields(vcsa6);

  let vcsa7 = grok(pattern: "%{HOSTNAME:vmw_vc_virtual_machine_name} on  %{IPV4:vmw_vc_esxi_hosting_ip} in %{HOSTNAME:vmw_vc_datacenter_name} %{GREEDYDATA:vmw_vc_status_action}", value: to_string(msg), only_named_captures: true);
  set_fields(vcsa7);

  let vcsa8 = grok(pattern: "%{HOSTNAME:vmw_vc_virtual_machine_name} on %{IPV4:vmw_vc_esxi_hosting_ip} in %{HOSTNAME:vmw_vc_datacenter_name} %{GREEDYDATA:vmw_vc_status_action}", value: to_string(msg), only_named_captures: true);
  set_fields(vcsa8);

  let vcsa9 = grok(pattern: "%{DATA:vmw_vc_status_action} for %{HOSTNAME:vmw_vc_virtual_machine_name} on %{IPV4:vmw_vc_esxi_hosting_ip} in %{HOSTNAME:vmw_vc_datacenter_name}", value: to_string(msg), only_named_captures: true);
  set_fields(vcsa9);

  let vcsa10 = grok(pattern: "%{DATA:vmw_vc_login_status} login %{DATA:vmw_vc_user} from %{IPV4:vmw_vc_src_ip} at %{DATA:vmw_vc_attempt_date} in %{GREEDYDATA:vmw_vc_login_type}", value: to_string(msg), only_named_captures: true);
  set_fields(vcsa10);

  let vcsa11 = grok(pattern: "Cloning %{HOSTNAME:vmw_vc_virtual_machine_name} on %{IPV4:vmw_vc_esxi_hosting_ip}\\, in %{HOSTNAME:vmw_vc_datacenter_name} to %{HOSTNAME:vmw_vc_target_virtual_machine_name} on %{IPV4:vmw_vc_target_esxi_hosting_ip}\\, %{DATA:vmw_vc_storage_name} in %{GREEDYDATA:vmw_vc_target_datacenter_name}", value: to_string(msg), only_named_captures: true);
  set_fields(vcsa11);

  let vcsa12 = grok(pattern: "Virtual machine %{HOSTNAME:vmw_vc_virtual_machine_name} disks consolidated %{DATA:vmw_vc_snapshot_remove_status} on %{IPV4:vmw_vc_esxi_hosting_ip} in cluster %{DATA:vmw_vc_cluster_name} in %{HOSTNAME:vmw_vc_target}", value: to_string(msg), only_named_captures: true);
  set_fields(vcsa12);

  let vcsa13 = grok(pattern: "%{DATA:vmw_vc_status_action} %{HOSTNAME:vmw_vc_virtual_machine_name} on %{IPV4:vmw_vc_esxi_hosting_ip} from %{HOSTNAME:vmw_vc_datacenter_name}", value: to_string(msg), only_named_captures: true);
  set_fields(vcsa13);

  let vcsa14 = grok(pattern: "%{DATA:vmw_vc_scan_status} scanned %{HOSTNAME:vmw_vc_virtual_machine_name} for %{DATA:vmw_vc_upgrade_component} upgrades.", value: to_string(msg), only_named_captures: true);
  set_fields(vcsa14);

  let vcsa15 = grok(pattern: "Warning message on %{DATA:vmw_vc_virtual_machine_name} on %{IPV4:vmw_vc_esxi_hosting_ip} in %{DATA:vmw_vc_target}\\: USB device \\\"%{DATA:vmw_vc_usb_device}\\\" %{DATA:vmw_vc_status_action} to the virtual machine.", value: to_string(msg), only_named_captures: true);
  set_fields(vcsa15);

  let vcsa16 = grok(pattern: "%{DATA:vmw_vc_virtual_machine_name} %{DATA:vmw_vc_status_action} the guest OS on %{IPV4:vmw_vc_esxi_hosting_ip} in %{HOSTNAME:vmw_vc_datacenter_name}\\: Cannot complete operation because %{DATA:vmw_vc_target_object} in this virtual machine", value: to_string(msg), only_named_captures: true);
  set_fields(vcsa16);

end

