rule "Syslog - VMWARE ESXI - ssoadminserver 02"
when
  regex("ssoadminserver", to_string($message.application_name)).matches == true
then
  let msg = to_string($message.vmw_vc_desc);

  let ssoadminserver2 = grok(pattern: "User %{DATA:vmw_vc_user} is %{DATA:vmw_vc_action_status} for method call \\'%{DATA:vmw_vc_method_call}\\'", value: to_string(msg), only_named_captures: true);
  set_fields(ssoadminserver2);

  let ssoadminserver3 = grok(pattern: "User \\{Name: %{DATA:vmw_vc_user}\\, Domain: %{DATA:vmw_vc_domain}\\} with vmw_vc_role \\'%{DATA:vmw_vc_role}\\' is %{DATA:vmw_vc_action_status} for method call \\'%{DATA:vmw_vc_method_call}\\'", value: to_string(msg), only_named_captures: true);
  set_fields(ssoadminserver3);

  let ssoadminserver6 = grok(pattern: "\\[User \\{Name: %{DATA:vmw_vc_user}\\, Domain: %{DATA:vmw_vc_domain}\\} with vmw_vc_role \\'%{DATA:vmw_vc_role}\\'\\] %{DATA:vmw_vc_user_action} %{DATA:vmw_vc_target_action} for vmw_vc_user \\'\\{Name: %{DATA:target_user}\\, Domain: %{DATA:target_domain}\\}\\'", value: to_string(msg), only_named_captures: true);
  set_fields(ssoadminserver6);

  let ssoadminserver5 = grok(pattern: "\\[User \\{Name: %{DATA:vmw_vc_user}\\, Domain: %{DATA:vmw_vc_domain}\\} with vmw_vc_role \\'%{DATA:vmw_vc_role}\\'\\] %{DATA:vmw_vc_user_action} %{GREEDYDATA:vmw_vc_ssoadminserver_action}", value: to_string(msg), only_named_captures: true);
  set_fields(ssoadminserver5);

  let ssoadminserver4 = grok(pattern: "Vmodl method %{DATA:method} return value is %{GREEDYDATA:vmw_vc_return_value}", value: to_string(msg), only_named_captures: true);
  set_fields(ssoadminserver4);

  let ssoadminserver7 = grok(pattern: "\\[User %{USERNAME:vmw_vc_user}\\] %{DATA:vmw_vc_user_action} %{GREEDYDATA:vmw_vc_target_action}", value: to_string(msg), only_named_captures: true);
  set_fields(ssoadminserver7);

  let ssoadminserver8 = grok(pattern: "User \\{Name: %{DATA:vmw_vc_user}\\, Domain: %{DATA:vmw_vc_domain}\\} with vmw_vc_role \\'%{DATA:vmw_vc_role}\\' logged %{DATA:vmw_vc_logged_action}\\.", value: to_string(msg), only_named_captures: true);
  set_fields(ssoadminserver8);

  let ssoadminserver9 = grok(pattern: "%{WORD:vmw_vc_token} for vmw_vc_SubjectNameId \\[value=%{DATA:vmw_vc_SubjectNameId}\\@%{DATA:vmw_vc_domain}\\, vmw_vc_format=%{DATA:vmw_vc_format}\\] %{GREEDYDATA:vmw_vc_ssoadminserver_action}", value: to_string(msg), only_named_captures: true);
  set_fields(ssoadminserver9);

  let ssoadminserver10 = grok(pattern: "%{DATA:vmw_vc_info} created in vmw_vc_pool %{USERNAME:vmw_vc_pool} \\[vmw_vc_tenantName=%{DATA:vmw_vc_tenantName}\\, vmw_vc_username=%{DATA:vmw_vc_username}\\@%{DATA:vmw_vc_domain}\\, vmw_vc_authType=%{DATA:vmw_vc_authType}\\, vmw_vc_useGCPort=%{DATA:vmw_vc_useGCPort}\\, vmw_vc_connectionString=%{DATA:vmw_vc_connectionString}\\]", value: to_string(msg), only_named_captures: true);
  set_fields(ssoadminserver10);











